import axios from 'axios'
import * as type from '../actionTypes'


const initItem = {
    product: {},
    accepted: '',
}

 const AddProduct = (state = initItem, action: {type: string; payload: any} ) => {
    switch (action.type) {
        case type.ADD_PRODUCT:
            return {
                ...state,
                loading: false,

            }
    }
}



export default AddProduct
